    // This map will grow whenever a Color gets created with a new
    // unrecognized value (a potential memory leak if the user is not
    // careful). Keep this field lower case to avoid clashing with
    // generated member names which will always be upper cased (Java
    // convention)
    private static final Map<String, LanguageEnumValue> values = createValuesMap();
    private static final Map<String, LanguageEnumValueEnum> enums = createEnumsMap();

    private final String value;

    private LanguageEnumValue(String value) {
        this.value = value;
    }

    /**
     * Returns a LanguageEnumValue with the given value. For a specific value the 
     * returned object will always be a singleton so reference equality 
     * is satisfied when the values are the same.
     * 
     * @param value value to be wrapped as LanguageEnumValue
     */ 
    public static LanguageEnumValue of(String value) {
        synchronized (LanguageEnumValue.class) {
            return values.computeIfAbsent(value, v -> new LanguageEnumValue(v));
        }
    }

    public String value() {
        return value;
    }

    public Optional<LanguageEnumValueEnum> asEnum() {
        return Optional.ofNullable(enums.getOrDefault(value, null));
    }

    public boolean isKnown() {
        return asEnum().isPresent();
    }

    @Override
    public int hashCode() {
        return Objects.hash(value);
    }

    @Override
    public boolean equals(java.lang.Object obj) {
        if (this == obj)
            return true;
        if (obj == null)
            return false;
        if (getClass() != obj.getClass())
            return false;
        LanguageEnumValue other = (LanguageEnumValue) obj;
        return Objects.equals(value, other.value);
    }

    @Override
    public String toString() {
        return "LanguageEnumValue [value=" + value + "]";
    }

    // return an array just like an enum
    public static LanguageEnumValue[] values() {
        synchronized (LanguageEnumValue.class) {
            return values.values().toArray(new LanguageEnumValue[] {});
        }
    }

